CREATE TABLE property(
   location        VARCHAR(100) NOT NULL PRIMARY KEY
  ,type            VARCHAR(100) NOT NULL
  ,availablity     BIT  NOT NULL
  ,size            VARCHAR(24) NOT NULL
  ,selling_price   NUMERIC(5,2) NOT NULL
  ,renting_price   NUMERIC(5,2) NOT NULL
  ,agent_id        INTEGER  NOT NULL
  ,date_of_entry   VARCHAR(100) NOT NULL
  ,date_of_selling VARCHAR(100) NOT NULL
  ,buyer_id        INTEGER  NOT NULL
);
